  if (!loading) return <div></div>

  return (
    <div style={{
      position: "absolute",
      width: "100px",
      height: "30px",
      left: "45%",
      top: "50%",
      backgroundColor: "blue",
      lineHeight: "20px",
      textAlign: "center",
      paddingTop: "10px"
    }}>
      Loading...
    </div>
  )
}
